import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { dashboardManager } from '../redux/slices/managerSlices'
import { Table, Row, Col, Tooltip, User, Text ,Button} from "@nextui-org/react";
import { Link, Navigate } from "react-router-dom";
// import { EditIcon } from "./Icon/EditIcon";
// import { DeleteIcon } from "./Icon/DeleteIcon";
const Home = () => {
    const dispatch=useDispatch();
    useEffect(()=>{
        dispatch(dashboardManager());
        },[dispatch]);

const emplyeedata=useSelector((state)=>state?.users?.dashboardData);
const {employees}=emplyeedata.userAuth;
    const columns = [
        { name: "NAME", uid: "name" },
        { name: "ROLE", uid: "role" },
        { name: "STATUS", uid: "status" },
        { name: "ACTIONS", uid: "actions" },
      ];
      const users = [
        {
          id: 1,
          name: "Tony Reichert",
          role: "CEO",
          team: "Management",
          status: "active",
          age: "29",
          avatar: "https://i.pravatar.cc/150?u=a042581f4e29026024d",
          email: "tony.reichert@example.com",
        },
        {
          id: 2,
          name: "Zoey Lang",
          role: "Technical Lead",
          team: "Development",
          status: "paused",
          age: "25",
          avatar: "https://i.pravatar.cc/150?u=a042581f4e29026704d",
          email: "zoey.lang@example.com",
        },
        {
          id: 3,
          name: "Jane Fisher",
          role: "Senior Developer",
          team: "Development",
          status: "active",
          age: "22",
          avatar: "https://i.pravatar.cc/150?u=a04258114e29026702d",
          email: "jane.fisher@example.com",
        },
        {
          id: 4,
          name: "William Howard",
          role: "Community Manager",
          team: "Marketing",
          status: "vacation",
          age: "28",
          avatar: "https://i.pravatar.cc/150?u=a048581f4e29026701d",
          email: "william.howard@example.com",
        },
        {
          id: 5,
          name: "Kristen Copper",
          role: "Sales Manager",
          team: "Sales",
          status: "active",
          age: "24",
          avatar: "https://i.pravatar.cc/150?u=a092581d4ef9026700d",
          email: "kristen.cooper@example.com",
        },
      ];
      const renderCell = (employee, columnKey) => {
        const cellValue = employee[columnKey];
        switch (columnKey) {
          case "name":
            return (
              <User squared src='https://cdn-icons-png.flaticon.com/512/149/149071.png' name={employee.firstName +' '+employee} css={{ p: 0 }}>
                {employee.email}
              </User>
            );
          case "role":
            return (
              <Col>
                <Row>
                  <Text b size={14} css={{ tt: "capitalize" }}>
                    {cellValue}
                  </Text>
                </Row>
                <Row>
                  <Text b size={13} css={{ tt: "capitalize", color: "$accents7" }}>
                    {employee?.createdAt}
                  </Text>
                </Row>
              </Col>
            );
          case "status":
            return <Button >1</Button>;
    
          case "actions":
            return (
              <Row justify="center" align="center">
               
                <Col css={{ d: "flex" }}>
                  <Tooltip content="Edit user">
                  <Button >1</Button>
                  </Tooltip>
                </Col>
                <Col css={{ d: "flex" }}>
                  <Tooltip
                    content="Delete user"
                    color="error"
                    onClick={() => console.log("Delete user",employee.empId)}
                  >
                <Button >1</Button>
                  </Tooltip>
                </Col>
              </Row>
            );
          default:
            return cellValue;
        }
      };
  return (
    <div>
         <Table
      aria-label="Example table with custom cells"
      css={{
        height: "auto",
        minWidth: "100%",
      }}
      selectionMode="none"
    >
      <Table.Header columns={columns}>
        {(column) => (
          <Table.Column
            key={column.uid}
            hideHeader={column.uid === "actions"}
            align={column.uid === "actions" ? "center" : "start"}
          >
            {column.name}
          </Table.Column>
        )}
      </Table.Header>
      <Table.Body items={employees}>
        {(item) => (
          <Table.Row>
            {(columnKey) => (
              <Table.Cell>{renderCell(item, columnKey)}</Table.Cell>
            )}
          </Table.Row>
        )}
      </Table.Body>
    </Table>
    </div>
  )
}

export default Home
